window.bookSummaryJSON = "<p>The Self Published Fantasy Blog-Off 6 semi finalist, now in audio.</p> <p>Finance: The lifeblood of any country’s beating heart and the life’s work of Sailor Kelstern — Merchant Banker. While wizards brood in their towers and great warriors charge into battle, Sailor is more interested in the price of ore, herbs, and alchemicals carried by the trade ships.&nbsp;</p> <p>But when a spell of bad fortune and bitter rivalry leaves him scrambling to turn a profit on little more than winds and whispers, one such whisper catches Sailor’s ear — a dragon has been seen in the west.&nbsp;</p> <p>Sailor soon finds that the dragons are very real, and not at all what he expected. And they practice a very different sort of economy — one of subterfuge and fire.&nbsp;</p> <p>A standalone novel of epic fantasy and adventure capitalism from the author of <i>Vick's Vultures</i>, with bonus novelette: \"Forego Quest\".&nbsp;</p> <p>What if you were the hero of every song, story, and legend?&nbsp;</p> <p>What if you didn’t want to be?&nbsp;</p> <p>Find out in this hilarious fantasy short.</p>"; 
